// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;


contract ENSHadler {

// 기존 nameHash, label, owner, resolver의 데이터를 이용해서 subonde를 사용할 수 있도록 test해보자 

function setSubNode(address ENS, bytes32 node, bytes32 label, address owner, address resolver, uint64 ttl) external {
   (bool success, ) = ENS.call(abi.encodeWithSignature("setSubnodeRecord(bytes32 node, bytes32 label, address owner, address resolver, uint64 ttl)",node,label,owner,resolver,ttl));
       require(success, "call failed"); 
 }
}

